Object.assign(_wg, {
    toggle_mk_terms: function(s, e) {
        var r = e.closest("form").find(".terms_chk:visible");
        switch (s) {
        case "enabled":
            r.prop({
                required: !0,
                disabled: !1
            }),
            r.closest(".form-group").removeClass("no_spon transition").addClass("has-error"),
            jQuery('input[name="b_submit_no_spon"]').val("0");
            break;
        case "disabled":
            r.prop({
                required: !1,
                checked: !1,
                disabled: !0
            }),
            r.closest(".form-group").removeClass("has-error").addClass("no_spon transition"),
            jQuery('input[name="b_submit_no_spon"]').val("1")
        }
    }
});
